Insidious:
proceeding in a gradual but harmful way.
Synonyms: crafty, treacherous

Yesterday, I previewed a virtual field trip put out by Discovery Education before showing it to my 4th through 6th graders.
I will not be showing it.

The preview says students will get to "ride" inside a Tundra Buggy to see polar bears in Canada around Lake Huron.
Sure, there are 3 adults inside it talking about how the Buggy helps scientists study the bears safely...
But the Buggy never moves.  Every now and then, the camera shows a bear rolling around outside about 250 feet away, but that's it.  
Instead of showing how the Buggy works or driving around in it to see actual polar bears, the adults spend nearly the entire 40 minute "trip" providing background info so the students can fully appreciate climate change and its disruptive influence on polar bears.
Who are these adults?  Scientists?
No.  One is an employee who manages the Buggy.  One is an activist for Polar Bears International.
And the third is a representative from the Lego Group, an activist arm of the Lego Company.

This was not a virtual field trip. 
It was a chance to influence impressionable young minds with a point-of-view.

Perhaps our climate is changing.  But let's use facts to inform our young learners.  
When adults tell children what to think rather than present data so kids can form educated opinions, we create a climate of indoctrination rather than education.  
This is a dangerous slippery slope, because the more ingrained this type of teaching becomes, the less we can tell the difference between fact and opinion.

And it is insidious.

